import React from 'react';

import './App.css';

function App() {
  return (

      <div className="grid-container">
        <header className="container">
          <h1 className="header1">Dairy For all</h1>
         <h2 className="header2">Milk and Cheese </h2>
        </header>

        <main className="main">
         <p><br/>Welcome to our our website</p>
        </main>
        <footer className="footer">For more information call us at :059-999999</footer>
      </div>

  );
}

export default App;
